import { LossActionRow } from './LossActionRow';

export function LossActionLevelOne({data, columnProps}){


    return data.actionChildItemList.map((itemLevelFourth, index) => {
      return (
        <LossActionRow
          columnProps={columnProps}
          data={itemLevelFourth}
          padding={45}
          color="orange"
        />
      )
    });
  
}
